Nepali Date Converter helps to convert Nepali date to equivalent English(Gregorian) date and vice versa.

Implementation:
Using NepaliDateConverter;

Console.WriteLine("Nep To Eng: "+new DateConverter().NepToEng(2050,06,14));

Console.WriteLine("\nEng To Nep: "+new DateConverter().EngToNep(1993, 09,30));

Console.ReadKey();

This NuGet package contains: jquery-1.6-vsdoc.js, start.debug.js, start.js.
With start.js you can load into your project Jquery 1.6, JqueryUI 1.8.12, jquery.validate 1.8 and jquery Mobile-1.0a4.1.js e.g. Sys.require([Sys.scripts.jQuery, Sys.scripts.jQueryUI]); Sys.onReady(function () { $("p").css("border", "3px solid red"); });
New in v1.2 when you use jQueryUI, jQueryMobile or jQueryValidate Jquery it's automatycly added as a dependency. While developing use jquery vsdoc.js and start.debug.js --- Start.js on production
